import React from 'react';
import {connect} from 'react-redux';
import {openPopup, closePopup} from '../store/modal/actions';
import {addNotify} from '../store/notify/actions';
import {getUserProjects, createUserProject} from '../store/projects/actions';
import Home from '../components/Home/Home';

function HomeContainer(props) {
  return (
    <Home 
      popupIsOpen={props.popupIsOpen}
      openPopup={props.openPopup}
      addNotify={props.addNotify}
      closePopup={props.closePopup}
      getUserProjects={props.getUserProjects}
      deleteUserProject={props.deleteUserProject}
      createUserProject={props.createUserProject}
      myProjects={props.myProjects}
    />
  );
}

const mapStateToProps = (state) => {
  return {
    popupIsOpen: state.modal.popupIsOpen,
    myProjects: state.projects.myProjects,
  }
};

const mapDispatchToProps = {
  openPopup,
  closePopup,
  getUserProjects,
  createUserProject,
  addNotify 
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeContainer);
